class MovePiecesToObtainStringSolution {
    public boolean canChange(String start, String target) {
        char[] s = start.toCharArray(), t = target.toCharArray();
        int n = s.length;
        int lCount = 0, rCount = 0;
        for(int i=0; i<n; i++) {
            if(s[i]=='R') {
                if(lCount>0) return false;
                rCount++;
            }
            if(t[i]=='L') {
                if(rCount>0) return false;
                lCount++;
            }
            if(t[i]=='R') {
                if(rCount==0) return false;
                rCount--;
            }
            if(s[i]=='L') {
                if(lCount==0) return false;
                lCount--;
            }
        }
        return lCount==0 && rCount==0;
    }
}
